import data from '../../json/database.json';  // Asegúrate de que el archivo esté en `src/json/`

export const fetchData = () => {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve(data);
    }, 500);  // Simulamos un pequeño retraso en la carga de datos
  });
};
